البعدُ لا يقلّل مقدار المحبّة.. وأنتم أيّها المتعلّمون أثبتّم ذلك بإطلالتكم اليوم من خلال المنصّة الالكترونيّة، لنجدّد عهد هذه المحبّة من جديدٍ ونغرسَ بذور العلم والمعرفة الّتي ستزهر أملًا ونجاحًا لا حدود له رغم أنف البُعد الذي فرضته جائحة كورونا.
